import React from 'react';
// import './Slider.css';
import $ from 'jquery';
import './SliderResponsive2017/css/flexslider.css';

class Slider extends React.Component {
  componentDidMount() {
    $(this.refs.slider).flexslider({
      animation: "slide",
      directionNav: true,
      controlNav: false,
      prevText: "<i class='fas fa-angle-left'></i>",
      nextText: "<i class='fas fa-angle-right'></i>"
    });
  }

  render() {
    return (
      <div>
        <br/><br/><br/>
        <div className="flexslider" ref="slider">
          <ul className="slides">
            <li>
              <img src="img/1.1.png" alt="" />
            </li>
            <li>
              <img src="img/1.2.png" alt="" />
            </li>
            <li>
              <img src="img/1.3.png" alt="" />
            </li>
            <li>
              <img src="img/1.4.png" alt="" />
            </li>
            <li>
              <img src="img/1.1.png" alt="" />
            </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default Slider;
